import { FaServicestack } from 'react-icons/fa'




const Navigator=()=>{
    const styles = {
        fontSize: '30px'
      };

    return(
   <div>
    <nav className="navbar navbar-expand-lg navbar-light bg-warning">
  <a className="navbar-brand" href="#" style={{fontSize:'50px'}}>OnlineShopping</a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span> 
  </button>

      {//this is login button*****************************************************************************************
      }
       <div className="collapse navbar-collapse  justify-content-end">

      <ul className="navbar-nav ml-auto">
     <li className="nav-item active">
     <FaServicestack />
     <a className="nav-link" href="#"data-toggle="modal" data-target="#cart"><i className="fa fa-cart-plus" style={styles}></i><span className="ml-1 card-items" style={styles}></span></a>
     </li>

   <li className="nav-item active">
   <a className="nav-link" href="#!" style={{fontSize:'30px'}}>Login</a>
   </li>
   <li className="nav-item active">
   <a className="nav-link" href="#!"style={{fontSize:'30px'}}>Register</a>
   </li>
   </ul>
   </div>
</nav>

   </div>

    );
}
export default Navigator;
